function _precompile_()
    ccall(:jl_generating_output, Cint, ()) == 1 || return nothing
    precompile(Tuple{typeof(Juno.errmsg), Atom.DisplayError})
    precompile(Tuple{typeof(Juno.undefs), Array{Float64, 1}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:pre}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:table}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:span}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:td}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:em}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:a}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:tr}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:p}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:hr}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:h1}})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:code}})
    precompile(Tuple{typeof(Juno.link), String, Int})
    precompile(Tuple{typeof(Juno.view), Hiccup.Node{:div}})
    precompile(Tuple{typeof(Juno.view), Base.Dict{Symbol, Any}})
    precompile(Tuple{typeof(Juno.view), Base.Dict{Any, Any}})
    precompile(Tuple{typeof(Juno.view), Base.SubString{String}})
    precompile(Tuple{typeof(Juno.view), String})
    precompile(Tuple{typeof(Juno.view), Method})
end
